def countlocSquare(sudoite, kaolinite, illite):
  loc = []
  for i in range(-180,180,1):
    strip = []
    for j in range(-90,90,1):
      strip.append([0,0,0])
    loc.append(strip)

  for i in sudoite:
    longi = int(i[0])
    lati = int(i[1])
    loc[lati][longi][0] += 1

  for i in kaolinite:
    longi = int(i[0])
    lati = int(i[1])
    loc[lati][longi][1] += 1

  for i in illite:
    longi = int(i[0])
    lati = int(i[1])
    loc[lati][longi][2] += 1

  return loc

def getNonEmptyIndex(data):
  newData = []
  for i in range(len(data)):
    for j in range(len(data[i])):
      if data[i][j][0] != 0 or data[i][j][1] != 0 or data[i][j][2] != 0:
        newData.append([i-180,j, data[i][j][0], data[i][j][1], data[i][j][2]])
  return newData

def scoreCells(data):
  newData = []
  for i in range(len(data)):
    newData.append([data[i][0], data[i][1], data[i][2], data[i][3], data[i][4], data[i][2]+data[i][3]+data[i][4]])
  return newData

def countCellsEachScore(data):
  newData = []
  for i in range(100):
    newData.append(0)
  for i in range(len(data)):
    newData[data[i][5]] += 1
  return newData
